    title = input('Enter title of the book to remove: ')
    for i in inventory:
        if i[0]==title:
            inventory.remove(i)
    print(f"Book '{title}' removed successfully")

def estimate_profit():
    count = 0.0
    for i in inventory:
        count += i[2]*i[3]*0.7
    print(f"Estimated Profit: {count}")
    
