using namespace std;

const int INF = 1e18;

struct Segtree {
    int sz;
    vector<int> t, lz;

    Segtree(int n) {
        sz = 1;
        while (sz < n) {
            sz *= 2;
        }
        t.resize(2 * sz);
        lz.resize(2 * sz);
    };

    void push(int x, int tl, int tr) {
        if (lz[x] != 0) {
            t[x] += lz[x];
            if (tl + 1 != tr) {
                lz[2 * x + 1] += lz[x];
                lz[2 * x + 2] += lz[x];
            }
            lz[x] = 0;
        }
    }

    void update(int l, int r, int v, int x, int tl, int tr) {
        push(x, tl, tr);
        if (tl >= r || tr <= l) {
            return;
        }
        if (tl >= l && tr <= r) {
            t[x] += v;
            if (tl + 1 != tr) {
                lz[2 * x + 1] += v;
                lz[2 * x + 2] += v;
            }
            return;
        }
        int mid = (tl + tr) >> 1;
        update(l, r, v, 2 * x + 1, tl, mid);
        update(l, r, v, 2 * x + 2, mid, tr);
        t[x] = min(t[2 * x + 1], t[2 * x + 2]);
    }

    void update(int l, int r, int v) {
        update(l, r, v, 0, 0, sz);
    }

    int query(int l, int r, int x, int tl, int tr) {
        push(x, tl, tr);
        if (tl >= r || tr <= l) {
            return INF;
        }
        if (tl >= l && tr <= r) {
            return t[x];
        }
        int mid = (tl + tr) >> 1;
        return min(query(l, r, 2 * x + 1, tl, mid), query(l, r, 2 * x + 2, mid, tr));
    }

    int query(int l, int r) {
        return query(l, r, 0, 0, sz);
    }
};

void solve() {
    int n, m, k;
    cin >> n >> m >> k;

    string s;
    cin >> s;

    vector<vector<int>> cost(m, vector<int>(m));
    rep(i, m) {
        rep(j, m) {
            cin >> cost[i][j];
        }
    }

    rep(k, m) {
        rep(i, m) {
            rep(j, m) {
                cost[i][j] = min(cost[i][j], cost[i][k] + cost[k][j]);
            }
        }
    }

    vector<Segtree> st(m, Segtree(n + 1)); // st[c][i] = dp[i] + cost to turn (i, end] to c
    rng(i, 1, n + 1) {
        rep(j, m) {
            st[j].update(0, i, cost[s[i - 1] - 'a'][j]);
        }

        int cur = INF;
        rep(j, m) {
            if (i - k >= 0) {
                cur = min(cur, st[j].query(0, i - k + 1));
            }
        }
        rep(j, m) {
            st[j].update(i, i + 1, cur);
        }
    }

    cout << st[0].query(n, n + 1) << '\n';
}

