use List::AllUtils  qw(product pairwise);
use POSIX           qw(ceil floor);

sub count_wins {
    my ($t, $d) = @_;

    $d++;
    my $upper = floor(($t + sqrt( $t*$t - 4*$d )) / 2);
    my $lower = ceil (($t - sqrt( $t*$t - 4*$d )) / 2);

    return ($upper - $lower + 1);
}

