local function create(instType)
	local obj=Instance.new(instType);
	return(function(data)
		for b,a in pairs(data)do 
			if(type(b)=='number')then 
				a.Parent=obj;
			else 
				obj[b]=a;
			end;
		end;
		return(obj);
	end);
end;

